- input: "TEXT\x1CC00348540\x1C.TEXT\x1C\x1CF3XA\x1CApril 22, 2008  Mr. Christopher
    Morse  In response to your letter dated March 26, 2008, please be advised that
    the Committee believed that it had provided sufficient disclosure of the identification
    of all individuals who contribute in excess of $200 in a calendar year.  It has,
    however, modified this disclosure in the amended report by including information
    that was not contained in the original report.  (To the extent that any information
    is still missing, the Committee has used its 'best efforts' to collect this information.
    \ Its original solicitation did include a clear and conspicuous request for the
    contributor information and did inform the contributor of the requirements of
    federal law for the reporting of such information.  In addition, the Committee
    did make a stand alone follow up effort to obtain this information, which did
    include asking for the missing information, without soliciting a contribution,
    and informing the contributor of the requirements of federal law for the reporting
    of such information.  These requests are documented in writing.)  The report has
    also been revised to correctly reflect contribution refunds that were inadvertently
    reported on the wrong line.  The Committee is implementing corrective measures
    to reinforce its reporting procedures.  It recognizes the importance of timely
    and accurate reporting and appreciates your assistance in this matter."
